import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Dojo Blog</h1>
      <div className="links">
        <Link to="/" className="Nav-item">Home</Link>
        <Link to="/recipes" className="Nav-item">Recipes</Link>
        <Link to="/tech" >TechHub</Link>
        <Link to="/travel" className="Nav-item">Travel</Link>
        <Link to="/lifestyle" className="Nav-item">Lifestyle</Link>

        <Link to="/create" className="Nav-item" style={{ 
          color: 'white', 
          backgroundColor: '#f1356d',
          borderRadius: '8px' 
        }}>New Blog</Link>
      </div>
    </nav>
  );
}

export default Navbar;
